use b13_group1;

DROP TABLE IF EXISTS `user`;

CREATE TABLE user (
	user_id INT AUTO_INCREMENT,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	mobile VARCHAR(50),
	password VARCHAR(50),
	date_created DATE,
	last_tran_date DATE,
	balance_sgd DECIMAL(10,2),
	balance_usd DECIMAL(10,2),
	balance_eur DECIMAL(10,2),
	balance_gbp DECIMAL(10,2),
	PRIMARY KEY (user_id)
);


UPDATE user
SET password = "123";